import { useSelector } from 'react-redux';

function ApiListContents({ apiId }) {
  const { api } = useSelector((state) => state.api);

  return (
    <div className="ApiContents">
      <div className="ApiContents_ApiName">
        <span>
          {api.filter((apiItem) => apiItem.api_id === apiId)[0].api_name}
        </span>
      </div>
      <div className="ApiContents_ApiDescription">
        <span>discription</span><br/>
        <span>
          {api.filter((apiItem) => apiItem.api_id === apiId)[0].api_description}
        </span>
      </div>
    </div>
  );
}

export default ApiListContents;
